import React from 'react'
import { Link } from 'react-router-dom';
import './Navbar.css';


 function Navbar() {
  return (
    <div>
        <div className='rightSide'>
            <Link to="/Signup">SignUp</Link>
            <Link to="/Login">Login</Link>
        </div>
    </div>
  )
}
export default Navbar;
